import React from 'react';
import ListGroup from 'react-bootstrap/ListGroup';

class Playlist extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div>
            <p>{this.props.playlistName}</p>
            <UploadDialog
            collection={this.props.collection}
            parentCallback={this.handleCallbackFromUploadDialog}>
          </UploadDialog>
            <ListGroup>
                {this.props.songCollection.map(function (Song) {
                    return (
                        <Song></Song>
                    )
                })}
            </ListGroup>
            </div>
        )
    }
}

export default Playlist;
